la $t9, platformOptions #define pos
li shootPos1, 7452
li shootPos2, 13280

lw start4, 16($t9)
lw start5, 20($t9)
li numLives, 3
li repeat1, 0
li repeat2, 0

main:
	jal startScreenLoad #draws the pre-game start screen
	
gameStart:
	la $t8, movement
	
	jal drawBackground #draws the main games background
    	
    	jal loop #starts the game functions
    	
loop: #loop game functions
	jal drawHearts #draw num of lives
	jal drawSpawn #draws spawn platform
    	jal checkWin #checks win cond
	
    	jal heartPowerup #spawns in the powerup if players missing a life
	jal drawCharacter #draws in the player at its current location
	jal drawEnemy1 #enemy sprite 1
	jal drawEnemy2 #enemy sprite 2
    	jal drawPlatform1 #base platform
    	jal drawPlatform2 
    	jal drawPlatform3
    	jal drawPlatform4
    	jal drawEnemyShot1 #shooting enemies
    	jal drawEnemyShot2
    	jal movePlat1 #moving platforms
    	jal movePlat2
    	jal keyboardInput #checks keyboard input
    	
    	jal gravity #gravity func
    	jal bulletCollision #lose a life from bullets
    	jal heartPickup #code for powerup effect

    	li $v0, 32  #delay
    	li $a0, SLEEP
    	syscall 
	
	j loop
	
startScreenLoad: #alternate between 2 starting frames so it looks like its animated
	jal drawStartFrame1
	
	li $v0, 32 
    	li $a0, 500
    	syscall 
    	
    	jal drawStartFrame2
    	
    	li $v0, 32 
    	li $a0, 500
    	syscall 
    
    	jal checkStartKeyInput #check to see if keys pressed to start the game
    	
    	j startScreenLoad
    	
checkStartKeyInput: #checks if s key is pressed
   	li $t8, 0xffff0000 
   	lw $t8, 0($t8)
   	bne $t8, 1, return
  	li $t8, 0xffff0000
   	lw $t2, 4($t8)
 	  	
 	beq $t2, 0x53, gameStart #s is to start
   	beq $t2, 0x73, gameStart
   	
  	j return


